  styleUrls: ['./app.component.css']
})
export class AppComponent implements OnInit {
  title = 'ajProject';
  public usrRol3: string = "admin";
  // public click: string = "successAlert";
  constructor(){}
  ngOnInit(): void {
    // let click = localStorage.getItem('userRole');
    // console.log('userRole from localStorage', click);
    let usrRol3 = localStorage.getItem('userRole');
    console.log('userRole from localStorage', usrRol3);
  }

}
